import React from 'react';

function PropertyCard({ property }) {
  return (
    <div className="property-card">
      <img src={property.image_url} alt={property.title} />
      <div className="property-details">
        <h3>{property.title}</h3>
        <p><i className="fas fa-map-marker-alt"></i> {property.location}</p>
        <p>${property.price.toLocaleString()}</p>
        <div className="property-features">
          <span><i className="fas fa-bed"></i> {property.bedrooms}</span>
          <span><i className="fas fa-bath"></i> {property.bathrooms}</span>
          <span><i className="fas fa-vector-square"></i> {property.sqft} sqft</span>
        </div>
      </div>
    </div>
  );
}

export default PropertyCard;
